import { Navbar } from "react-bulma-companion";

const UsersPage = () => {
  return (
    <div>
      <Navbar>
        <Navbar.Menu>
          <Navbar.Start>
            <Navbar.Item tab active>
              All Users
            </Navbar.Item>
            <Navbar.Item tab>Add User</Navbar.Item>
          </Navbar.Start>
        </Navbar.Menu>
      </Navbar>
    </div>
  );
};

export default UsersPage;
